// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

// ==================== External Imports ====================

import {AccessControl} from "@openzeppelin/contracts/access/AccessControl.sol";

// ==================== Internal Imports ====================

import {ICanvasManagerV1} from "./interfaces/ICanvasManagerV1.sol";
import {IDrawHook} from "./interfaces/IDrawHook.sol";
import {IPixelCoin} from "./interfaces/IPixelCoin.sol";
import {IMarketProxy} from "./interfaces/IMarketProxy.sol";
import {ICanvasManagerV2} from "./interfaces/ICanvasManagerV2.sol";

import {Uint256ArrayUtil} from "./lib/Uint256ArrayUtil.sol";

import {PixNft} from "./PixNft.sol";
import {PixMoment} from "./PixMoment.sol";

/**
 * @title CanvasManagerV2
 * @author Matrix
 */
contract CanvasManagerV2 is ICanvasManagerV2, AccessControl {
    using Uint256ArrayUtil for uint256[];

    // ==================== Constants ====================

    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
    uint256 public constant PIX_COUNT = 1024; // count of pixels
    uint256 public constant OLD_MAX_ART_ID = 23; // max art id in old CanvasManager

    // ==================== Variables ====================

    PixNft internal immutable _pixNft; // pixel nft contract
    PixMoment internal immutable _pixMoment; // moment nft contract
    IPixelCoin internal immutable _pixelCoin; // pixel coin contract
    IMarketProxy internal _marketProxy; // market proxy contract
    ICanvasManagerV1 internal _oldCanvasManager; // old CanvasManager contract

    IDrawHook internal _drawHook; // draw hook function

    /// @notice art id range is (_minArtId, _maxArtId], valid art id begins from _minArtId + 1
    uint256 internal _minArtId; // min art id
    uint256 internal _maxArtId; // max art id
    uint256 internal _curArtId; // max id of opened arts

    uint256[] internal _openArtIds;
    uint256[] internal _closedArtIds;

    mapping(uint256 => Art) public _arts; // art id => Art
    mapping(uint256 => Moment) public _moments; // moment id => Moment

    // ==================== Constructor function ====================

    constructor(
        address nft,
        address moment,
        address pixelCoin,
        address marketProxy,
        address oldCanvasManager,
        uint256 minArtId
    ) {
        require(nft != address(0), "zero nft");
        require(moment != address(0), "zero moment");
        require(pixelCoin != address(0), "zero pixelCoin");
        require(marketProxy != address(0), "zero marketProxy");
        require(minArtId >= OLD_MAX_ART_ID, "small minArtId");

        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(ADMIN_ROLE, _msgSender());

        _pixNft = PixNft(nft);
        _pixMoment = PixMoment(moment);
        _pixelCoin = IPixelCoin(pixelCoin);
        _marketProxy = IMarketProxy(marketProxy);
        _oldCanvasManager = ICanvasManagerV1(oldCanvasManager);

        _minArtId = minArtId;
        _curArtId = minArtId;
        _maxArtId = minArtId + 1000;

        if (oldCanvasManager != address(0)) {
            IPixelCoin(pixelCoin).approve(oldCanvasManager, type(uint256).max);
        }
    }

    // ==================== Modifier functions ====================

    modifier onlyAdmin() {
        _onlyAdmin();
        _;
    }

    // ==================== External functions ====================

    function getPixNft() external view returns (address) {
        return address(_pixNft);
    }

    function getPixMoment() external view returns (address) {
        return address(_pixMoment);
    }

    function getOldCanvasManager() external view returns (address) {
        return address(_oldCanvasManager);
    }

    /// @notice set _oldCanvasManager to address(0) to disable it
    /// @dev this function is only called by admin
    function setOldCanvasManager(address newCanvasManager) external onlyAdmin {
        address oldCanvasManager = address(_oldCanvasManager);
        _oldCanvasManager = ICanvasManagerV1(newCanvasManager);

        if (newCanvasManager != address(0)) {
            _pixelCoin.approve(newCanvasManager, type(uint256).max);
        }

        emit SetOldCanvasManager(oldCanvasManager, newCanvasManager);
    }

    function getMarketProxy() external view returns (address) {
        return address(_marketProxy);
    }

    /// @dev this function is only called by admin
    function setMarketProxy(address newMarketProxy) external onlyAdmin {
        require(newMarketProxy != address(0), "zero newMarketProxy");

        address oldMarketProxy = address(_marketProxy);
        _marketProxy = IMarketProxy(newMarketProxy);

        emit SetMarketProxy(oldMarketProxy, newMarketProxy);
    }

    function getDrawHook() external view returns (address) {
        return address(_drawHook);
    }

    /// @notice set _drawHook to address(0) to disable it
    /// @dev this function is only called by admin
    function setDrawHook(address newDrawHook) external onlyAdmin {
        address oldDrawHook = address(_drawHook);
        _drawHook = IDrawHook(newDrawHook);

        emit SetDrawHook(oldDrawHook, newDrawHook);
    }

    function getArtIds()
        external
        view
        returns (
            uint256 min,
            uint256 max,
            uint256 current
        )
    {
        return (_minArtId, _maxArtId, _curArtId);
    }

    /// @dev this function can only be called by admin
    function setMinArtId(uint256 newMinArtId) external onlyAdmin {
        require(_minArtId == _curArtId, "minArtId is working");

        uint256 oldMinArtId = _minArtId;
        _minArtId = newMinArtId;

        emit SetMinArtId(oldMinArtId, newMinArtId);
    }

    /// @dev this function can only be called by admin
    function setMaxArtId(uint256 newMaxArtId) external onlyAdmin {
        require(newMaxArtId >= _curArtId, "small newMaxArtId");

        uint256 oldMaxArtId = _maxArtId;
        _maxArtId = newMaxArtId;

        emit SetMaxArtId(oldMaxArtId, newMaxArtId);
    }

    function getOpenArts() external view returns (uint256[] memory artIds) {
        artIds = (address(_oldCanvasManager) == address(0)) ? _openArtIds : _openArtIds.merge(_oldCanvasManager.getOpenArts());
    }

    function getEndArts() external view returns (uint256[] memory artIds) {
        artIds = (address(_oldCanvasManager) == address(0)) ? _closedArtIds : _closedArtIds.merge(_oldCanvasManager.getEndArts());
    }

    function getAllArts() external view returns (uint256[] memory artIds) {
        artIds = (address(_oldCanvasManager) == address(0))
            ? _closedArtIds.merge(_openArtIds)
            : _closedArtIds.merge(_openArtIds).merge(_oldCanvasManager.getAllArts());
    }

    function getMoment(uint256 uMomentId)
        external
        view
        returns (
            uint24[1024] memory colors,
            uint256 momentIndex,
            uint256 artId
        )
    {
        Moment storage moment = _moments[uMomentId];

        artId = moment.artId;
        if (artId != 0) {
            colors = moment.colors;
            momentIndex = moment.momentIndex;
        } else if (address(_oldCanvasManager) != address(0)) {
            (colors, momentIndex, artId) = _oldCanvasManager.getMoment(uMomentId);
        }
    }

    /// @notice this function does not check artId is a valid pixel nft id
    function getShares(uint256 artId, address contributor) external view returns (uint256 individualShares, uint256 totalShares) {
        if ((artId > _minArtId) && (artId <= _maxArtId)) {
            individualShares = 0;
            Art storage art = _arts[artId];
            totalShares = art.moments.length;
            for (uint256 i = 0; i < totalShares; ++i) {
                individualShares += (contributor == _pixMoment.ownerOf(art.moments[i])) ? 1 : 0;
            }
        } else if (address(_oldCanvasManager) != address(0)) {
            (individualShares, , totalShares, , ) = _oldCanvasManager.getNftPorfitInfo(artId, contributor);
        }
    }

    /// @dev this function is only called by admin
    function startNewArt(uint256 endTime) external onlyAdmin returns (uint256 artId) {
        require(_curArtId < _maxArtId, "art exhaust");
        require(endTime > block.timestamp, "small endTime");

        artId = ++_curArtId;
        _openArtIds.push(artId);

        Art storage art = _arts[artId];
        art.state = 1; // open
        art.startTime = block.timestamp;
        art.endTime = endTime;

        emit NewArt(_msgSender(), artId, art.startTime, art.endTime);
    }

    /// @dev this function is only called by admin
    function setEndTime(uint256 artId, uint256 newEndTime) external onlyAdmin {
        if ((artId > _minArtId) && (artId <= _maxArtId)) {
            require(artId <= _curArtId, "SET: not open");

            Art storage art = _arts[artId];
            require(art.state == 1, "SET: art close");
            require(newEndTime > art.startTime, "wrong endTime");
            uint256 oldEndTime = art.endTime;
            art.endTime = newEndTime;

            emit SetArtEndTime(_msgSender(), artId, oldEndTime, newEndTime);

            if (newEndTime <= block.timestamp) {
                _endArt(artId);
            }
        } else if (address(_oldCanvasManager) != address(0)) {
            _oldCanvasManager.setEndTime(artId, newEndTime);
        }
    }

    /// @notice this function can be called by everyone
    function endArt(uint256 artId) external {
        if ((artId > _minArtId) && (artId <= _maxArtId)) {
            require(artId <= _curArtId, "EA: not open");
            Art storage art = _arts[artId];

            require(art.state == 1, "EA: art close");
            require(block.timestamp >= art.endTime, "too early");

            _endArt(artId);
        } else if (address(_oldCanvasManager) != address(0)) {
            _oldCanvasManager.endArt(artId);
        }
    }

    function getArt(uint256 artId)
        external
        view
        returns (
            uint256 consumToken,
            uint32 momentIndex,
            uint24[PIX_COUNT] memory colors,
            uint256[PIX_COUNT] memory price,
            uint8 state,
            uint256[] memory moments,
            uint256 startTime,
            uint256 endTime
        )
    {
        if ((artId > _minArtId) && (artId <= _maxArtId)) {
            require(artId <= _curArtId, "GA: not open");

            Art storage art = _arts[artId];
            consumToken = art.consumToken;
            momentIndex = art.momentIndex;
            colors = art.colors;
            price = art.price;
            moments = art.moments;
            state = art.state;
            startTime = art.startTime;
            endTime = art.endTime;
        } else if (address(_oldCanvasManager) != address(0)) {
            return _oldCanvasManager.getArt(artId);
        }
    }

    function drawPixel(
        uint256 artId,
        uint256 index,
        uint24 color
    ) external {
        if ((artId > _minArtId) && (artId <= _maxArtId)) {
            require(artId <= _curArtId, "DP: not open");
            Art storage art = _arts[artId];
            require(art.state == 1, "DP: art close");
            require(art.endTime >= block.timestamp, "over time");

            _drawPixel(artId, index, color);
        } else if (address(_oldCanvasManager) != address(0)) {
            uint256 price = _oldCanvasManager.getDrawPrice(artId, index, 0);
            _pixelCoin.mint(address(this), price);

            _oldCanvasManager.drawPixel(0, artId, index, color, price);
            _pixelCoin.burn(address(_oldCanvasManager), price);

            uint256 momentId = _pixMoment.tokenOfOwnerByIndex(address(this), 0);
            _pixMoment.transferFrom(address(this), _msgSender(), momentId);
        }
    }

    function drawMultiPixel(
        uint256 artId,
        uint256[] memory indexes,
        uint24[] memory colors
    ) external {
        uint256 count = indexes.length;
        require(count > 0, "no pixel");
        require(count == colors.length, "indexes mismatch colors");

        if ((artId > _minArtId) && (artId <= _maxArtId)) {
            require(artId <= _curArtId, "DMP: not open");
            Art storage art = _arts[artId];
            require(art.state == 1, "DMP: art close");
            require(art.endTime >= block.timestamp, "over time");

            for (uint256 i = 0; i < count; i++) {
                _drawPixel(artId, indexes[i], colors[i]);
            }
        } else if (address(_oldCanvasManager) != address(0)) {
            uint256 totalPrice = 0;
            uint256[] memory prices = new uint256[](count);
            for (uint256 i = 0; i < count; i++) {
                uint256 price = _oldCanvasManager.getDrawPrice(artId, indexes[i], 0);
                totalPrice += price;
                prices[i] = price;
            }

            _pixelCoin.mint(address(this), totalPrice);
            for (uint256 i = 0; i < count; i++) {
                _oldCanvasManager.drawPixel(0, artId, indexes[i], colors[i], prices[i]);
                uint256 iMomentId = _pixMoment.tokenOfOwnerByIndex(address(this), 0);
                _pixMoment.transferFrom(address(this), msg.sender, iMomentId);
            }
            _pixelCoin.burn(address(_oldCanvasManager), totalPrice);
        }
    }

    // ==================== Internal functions ====================

    function _drawPixel(
        uint256 artId,
        uint256 index,
        uint24 color
    ) internal {
        require(index < PIX_COUNT, "big index");

        if (address(_drawHook) != address(0)) {
            _drawHook.execute(artId, index, color);
        }

        uint256 momentId = _pixMoment.mintMoment(_msgSender());

        Art storage art = _arts[artId];
        art.momentIndex = uint32(art.moments.length);
        art.moments.push(momentId);
        art.colors[index] = color;

        Moment storage moment = _moments[momentId];
        moment.colors = art.colors;
        moment.momentIndex = art.momentIndex;
        moment.artId = artId;

        emit DrawPixel(_msgSender(), artId, momentId, index, color);
    }

    function _endArt(uint256 artId) internal {
        // move artId from _openArtIds to _closedArtIds
        for (uint256 i = 0; i < _openArtIds.length; i++) {
            if (_openArtIds[i] == artId) {
                _openArtIds[i] = _openArtIds[_openArtIds.length - 1];
                _openArtIds.pop();
                break;
            }
        }
        _closedArtIds.push(artId);

        // set end flag
        Art storage art = _arts[artId];
        art.state = 2; // end

        // mint and create auction
        if (art.moments.length > 0) {
            _pixNft.mint(address(_marketProxy), artId);

            // use default currency, reservePrice, duration in MarketProxy
            _marketProxy.createAuction(artId, address(0), 0, 0, 0);
        }

        emit EndArt(_msgSender(), artId);
    }

    // ==================== Private functions ====================

    function _onlyAdmin() private view {
        require(hasRole(ADMIN_ROLE, _msgSender()), "not admin");
    }
